?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта швейцарская часовая компания была основана в 1882 году. Несмотря на всю популярность, Hanhart даже сейчас позиционируется как небольшая часовая фирма. Штаб-квартира компании расположена в Германии. Неудивительно, что часы приобрели популярность именно в этой стране. Основатель компании Иоганн Ханхарт. В то время, когда именно он управлял компанией, он достигла небывалых высот. Стоит отметить, что именно Hanhart выпустила первые часы с секундомером (это произошло в 1924 году). После этого, часовая компания выпускала и карманные часы, и хронографы. Все модели часов остаются популярны и по сей день, особенно они ценятся среди коллекционеров. Хоть дизайн часов Hanhart и похож на классический, они позиционируются компанией, как спортивные. В часах есть и великолепный дизайн, и качественные механизмы с оригинальными деталями.</span></span></p>
 
